//     Colors     //
class DarkTheme {
  final colorArray = {
    'errorColor': const Color(0xFFDF6060),
    'validColor': const Color(0xFF63C152),
    'primaryColor': const Color(0xFF1F1B24),
    'tileColor': const Color(0xFF1F1B24),
    'backgroundColor': const Color(0xFF000000),
    'accentColor': Colors.blue,
    'unselectedItemColor': Colors.white,
    'secondaryTextColor': Colors.white,
    'grayTextColor': const Color(0xFF8E8E93),
  };
  final Brightness currentBrightness = Brightness.dark;
  final ThemeMode currentThemeMode = ThemeMode.dark;
}

class LightTheme {
  final colorArray = {
    'errorColor': const Color(0xFFDF6060),
    'validColor': const Color(0xFF63C152),
    'primaryColor': const Color(0xFFFFFFFF),
    'tileColor': const Color(0xFFFFFFFF),
    'backgroundColor': const Color(0xFFF5F5F5),
    'accentColor': Colors.blue,
    'unselectedItemColor': Colors.black,
    'secondaryTextColor': Colors.black,
    'grayTextColor': const Color(0xFF8E8E93),
  };
  final Brightness currentBrightness = Brightness.light;
  final ThemeMode currentThemeMode = ThemeMode.light;
}

Color getTheme(String element) {
  if (Settings.getValue<bool>('key-dark-mode', false)) {
    return DarkTheme().colorArray[element]!;
  } else {
    return LightTheme().colorArray[element]!;
  }
}

ThemeMode getThemeMode() {
  if (Settings.getValue<bool>('key-dark-mode', false)) {
    return DarkTheme().currentThemeMode;
  } else {
    return LightTheme().currentThemeMode;
  }
}

Brightness getBrightness() {
  if (Settings.getValue<bool>('key-dark-mode', false)) {
    return DarkTheme().currentBrightness;
  } else {
    return LightTheme().currentBrightness;
  }
}

String getText(String element) {
  if (translation == 1) {
    return EnglishTranslation().translationArray[element]!;
  } else if (translation == 2) {
    return FrenchTranslation().translationArray[element]!;
  } else {
    return EnglishTranslation().translationArray[element]!;
  }
}

void updateFooterIndex(int index, BuildContext context) {
  footerIndex = index;
  if (footerIndex == 0) {
    Navigator.push(
        context, MaterialPageRoute(builder: (context) => HomePage()));
  } else {
    Navigator.push(
        context, MaterialPageRoute(builder: (context) => CardsPage()));
  }
}

